import React from 'react';
import { Navbar } from 'react-bootstrap';
import { BasicExample } from './Navbar';
import { useState,useEffect } from 'react';
import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';


export const Resume = () => {
    const [activeLink,setActiveLink]=useState('home')
    const [scrolled,setScrooled]= useState(false);
  return (

      <div style={{textAlign:"center"}}>
        <h1>Onur Korkmaz</h1>
        <Navbar bg="blue" expand="lg" className={scrolled ? "scrolled": ""}>

      <Container>
        <Navbar.Brand href="#home">
          <img src={''} alt='Logo' />
        </Navbar.Brand>
        <Navbar.Toggle aria-controls="basic-navbar-nav" />
        <span className='navbar-toggler-icon'></span>
        <Navbar.Collapse id="basic-navbar-nav">
          <Nav className="me-auto">
            <Nav.Link href="#home" className={activeLink ==='home' ? 'active navbar-link': 'navbar-link'} onClick={()=>('home')} >Home</Nav.Link>
            <Nav.Link href="#skills" className={activeLink ==='skills' ? 'active navbar-link': 'navbar-link'} onClick={()=>('skills')} >Skills</Nav.Link>
            <Nav.Link element={<Resume />} className={activeLink ==='resume' ? 'active navbar-link': 'navbar-link'}onClick={()=>NavigateToResume('resume')} >Resume</Nav.Link>
            <Nav.Link href="#coverletter" className={activeLink ==='coverletter' ? 'active navbar-link': 'navbar-link'} onClick={()=>('coverletter')} >Cover Letter</Nav.Link>
            <Nav.Link href="#careergoal" className={activeLink ==='careergoal' ? 'active navbar-link': 'navbar-link'} onClick={()=>('careergoal')} >Career Goal</Nav.Link>
            <Nav.Link href="#cerdegrees" className={activeLink ==='cerdegrees' ? 'active navbar-link': 'navbar-link'} onClick={()=>onUpdateActiveLink('cerdegrees')} >Certificates/Degrees  </Nav.Link>
            <Nav.Link href="#workexperience" className={activeLink ==='workexperience' ? 'active navbar-link': 'navbar-link'} onClick={()=>onUpdateActiveLink('howorkexperienceme')} >Work Experience </Nav.Link>      
          </Nav>

          <span className='navbar-text'>
            <div className='social-icon'>
              <a href='https://www.linkedin.com/in/onur-korkmaz-8a928719b/'><img src={navIcon1} alt="" /></a> 
              <a href='https://www.facebook.com/lhonour/'><img src={navIcon2} alt="" /></a>
              <a href='https://www.instagram.com/ozyyyyy__/'><img src={navIcon3} alt="" /></a>

            </div>
            < button className='vvd' onClick={()=> console.log('connect')}><span>Let's Connect</span></button>
          </span>
        </Navbar.Collapse>
      </Container>
      </Navbar>
      </div>



  );
};
